(520, NULL, 'Location Bâtiment', '???????? BURKINA FASO , OUAGADOUGOU ????????\n\n???? UN IMMEUBLE DE HAUT STANDING R+11-1 EN LOCATION À OUAGADOUGOU ????\n\n???? SITUATION GÉOGRAPHIQUE : Précisément à Situé sur l’Avenue Loudun Projet ZACA , Avenue parallèle à l’avenue Kwame Nkrumah. A 100 mètres de l’Aéroport International de Ouagadougou, porte UCOBAM ; bureau de poste ; COFINA. Le Bâtiment est bâti sur un terrain d’environ 3000 m², la bâtisse dispose d’une superficie exploitable d’environ 26 000 m².\n\nVous êtes exceptionnels, vous aimez l\'exception ! Et bien cette offre est pour vous, chez nous et nul part ailleurs !\nVOUS ÊTES UNE STRUCTURE COMME: BANQUE, ASSURANCE, ONG, ORGANISME INTERNATIONAL, MINE, ...\n\nNOUS METTONS À VOTRE DISPOSITION, UN BÂTIMENT FLAMBANT NEUF À PROJET ZAKA POUR L\'IMPLANTATION DE VOS LOCAUX. COMPOSITION :\n\n??Le bâtiment est composé de 11 niveaux:\n????Chaque niveau est composé de 2 compartiments, une superficie de 1600m2 au RDC, R+1, R+2 et 1320m2 pour les autres niveaux .\n\n??Au moins 60 bureaux par niveau\n???? Un sous sol abritant un parcking pour parker 150 véhicules !\n\n??Une capacité de stationnement d\'au moins 80 véhicules à la devanture\n????Possibilité de louer un seul compartiment de chaque niveau.\n\n? PRIX DU LOYER : à un prix de 7500f /m2 imbattable dans la zone.\nNB : Prix légèrement discutable en fonction de la superficie que vous voulez.', 'rent', '0', '', '6138d83c79ea6.png', '', '600000', 'FCFA', '', '', NULL, NULL, '', NULL, NULL, '', '3', '2', '3000', '1,3,4,6', '308', 'agent', 'Youssoupha', '7368b3c6b52f664d,a2444fb6183ce888', 2, 0, 'activated', '2021-09-08 15:35:24', '2021-09-08 15:35:24'),
