(719, NULL, 'Villa F4  avec PISCINE location SOMGANDE VERS BOULANGERIE 700mil', '??????????????????????????UN MAGNIFIQUE DUPLEX DE TYPE F4 AVEC PISCINE EN LOCATION A OUAGADOUGOU\n\n???????? QUARTIER SOMGANDE non loin de la BOULANGERIE WEND-KONTA environ 60m du GOUDRON RN3(KAYA)????????\n\nLOCATION d\'un duplex très bien entretenu, idéalement situé dans le quartier Somgandé non loin de la Boulangerie Wend-Konta à 100 m de la voie goudronnée (RN4).\nIl comporte au RDC un grand séjour de 70 m² avec une cuisine ouverte, une buanderie, une chambre avec de très beaux rangements et une salle d’eau. De magnifiques escaliers conduisent au R+1 où se trouvent deux chambres dont la belle chambre parentale avec une salle d’eau de style italien intégrée et un dressing; la seconde chambre comporte également des rangements et dispose d’une salle d’eau dans le couloir. La sortie du couloir donne sur une terrasse de 30 m² idéale pour passer du temps en famille ou entre amis. \nCe joyau offre à ses habitants un beau jardin au bord d’une belle piscine bien entretenue ; il dispose d’un garage pour deux voitures, un hangar de type case pour profiter du jardin, d’une dépendance et une toilette externe à l’arrière-cour. \nToutes les pièces sont ventilées et climatisées et les ouvertures, portes comme fenêtres ont des grillages et moustiquaires de l’extérieur.\nLa maison est parfaite pour une vie tranquille en famille car le calme qui y règne est très reposant. \nContactez-nous vite pour découvrir cette maison de belle qualité et y déposer vos valises !!!\n\n????PROXIMITÉ : BOULANGERIE WEND KONTA\n????LOYER MENSUEL : 700.000F CFA \n????CAUTION : 02 MOIS \n????AVANCE: 03 MOIS \n????PRESTATION: 01 MOIS\n\n???? NB DISPONIBLE DÉBUT JANVIER \n\n????????????whatsapp:74459559/79618634\n????Email :    koumbemau@gmail.com\n???? Nos horaires 7jours/7 de 08h00mn à 18h30 mn\n\n????????????NOTRE MISSION, C\'EST VOTRE SATISFACTION,merci de visiter nos différentes pages pour s\'acquérir les BONNES OPPORTUNITÉS IMMOBILIÈRES À JOURS. ????????????    https://www.facebook.com/maurice.kombema.1 ????????????\n\n    ?????Twitter :https://twitter.com/MauriceKombema?t=4SUg2Y9i74lxjA4NU9DPDg&s=08\n\n  ????https://www.instagram.com/invites/contact/?i=xttp9e1ascs6&utm_content=5k8yb78', 'sale', '0', '[{\"name\":\"63a42bdeb8091.png\",\"type\":\"\",\"url\":\"https://yedimmobiler.s3.us-east-2.amazonaws.com/properties/63a42bdeb8091.png\"}]', '63a42bdecd2df.png', '700000', '', 'FCFA', '3', '3', NULL, NULL, '', NULL, NULL, '', '7', NULL, '430', '1,2,3,4,6', '678', 'individual', 'Immo KOMBEMA', '678,672,677,ef19a45ead87a817', 4, 0, 'activated', '2022-12-22 10:05:18', '2022-12-22 10:05:18'),
